import React from "react";

function SideBar() {
 

  return (
    <Sidebar>
      <Options>Home</Options>
      <Options>Artists</Options>
      <Options>Albums</Options>
      <Options>Trends</Options>
      <Options>Playlist</Options>
    </Sidebar>
  );
}

export default SideBar;
